webpackJsonp([0x67f5c3525cc1],{334:function(A,e){A.exports={data:{markdownRemark:{html:'<h1>PolySat: The Cal Poly CubeSat Lab</h1>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 512px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Satellite"\n        title=""\n        src="/static/dave_pic-d51502cbe39459b4ff36236fdd5ee4c4-7132c.jpg"\n        srcset="/static/dave_pic-d51502cbe39459b4ff36236fdd5ee4c4-36d05.jpg 148w,\n/static/dave_pic-d51502cbe39459b4ff36236fdd5ee4c4-f4376.jpg 295w,\n/static/dave_pic-d51502cbe39459b4ff36236fdd5ee4c4-7132c.jpg 512w"\n        sizes="(max-width: 512px) 100vw, 512px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nPhoto from the first satellite I worked on to launch, DAVE\n</p>\n<p><a href="http://polysat.calpoly.edu">PolySat</a> has been a core component of my computer science education since I joined the program as a freshman at Cal Poly. PolySat is Cal Poly\'s <a href="https://en.wikipedia.org/wiki/CubeSat">CubeSat</a> program. CubeSats are 10x10x10 cm spacecraft that have risen sharply in popularity over the last 20 years.</p>\n<p>PolySat applies an industry-like software architecture that is based on C and Linux. All core programs are Linux processes that utilize our open source event loop and inter-process communication library <a href="https://github.com/PolySat/libproc">libproc</a>.</p>\n<p>Dividing functionality into processes enables us to reuse most of our flight software across missions, allowing us to focus on implementing new features instead of reimplementing old ones.</p>\n<p>I spent the summer of 2016 working full-time at PolySat, and I\'ve contributed part-time otherwise since starting college.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.68%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Satellite"\n        title=""\n        src="/static/dave-d2bf82672d9061126b0cd5ea77e798ea-ca545.jpg"\n        srcset="/static/dave-d2bf82672d9061126b0cd5ea77e798ea-aa1b7.jpg 148w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-b937a.jpg 295w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-ca545.jpg 590w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-75639.jpg 885w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-8bd51.jpg 1180w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-a3716.jpg 1770w,\n/static/dave-d2bf82672d9061126b0cd5ea77e798ea-3595f.jpg 2500w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nDAVE, a PolySat satellite measuring the damping properties of tungsten powder.\n</p>\n<h2>Software Lead</h2>\n<p>I served at the PolySat software lead from the end of my first year at Cal Poly to the beginning of my fourth year. In my time in this position, I\'ve learned that it can be quite challenging to manage a team of part-time programmers working on something as sophisticated as a satellite. This combined with the steadily increasing capability and complexity of the PolySat code base has led to several devops improvements. This includes upgrading our antiquated wiki and issue tracking system to <a href="https://about.gitlab.com/">GitLab</a>--a much more modern software development tool. In addition, I\'ve worked to add tests to software that previously had none. This motivated the addition of CI to our GitLab workflow, creating a much more robust development experience.</p>\n<p>Another part of my responsibility as software lead is interfacing with the companies we work with. Generally, this involves meeting with the engineers to figure out software requirements and ICD\'s.</p>\n<h2>Projects</h2>\n<p>I\'ve worked on a variety of things in my time at PolySat, ranging from long-term programming projects to late-night debugging sessions in the cleanroom.</p>\n<p>Here is a list of satellites that I\'ve directly contributed to:</p>\n<ul>\n<li><i>Ionsopheric Scintillation Explorer</i> (ISX). Collaboration with SRI International.</li>\n<li><i>Exocube 2</i>. Collaboration with NASA Goddard.</li>\n<li><i>Dampening and Vibrations Experiment</i> (DAVE). Collaboration with Northrop Grumman.</li>\n<li><i>Launch Environment Observer</i> (LEO). Collaboration with NASA.</li>\n<li><i>LightSail 2</i>. Collaboration with Planetary Society.</li>\n</ul>\n<br>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 430px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 177.90697674418604%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="PolySat Late"\n        title=""\n        src="/static/polysat_late-e4f461f97bd00990f2836a12fd487aa8-bacc8.jpg"\n        srcset="/static/polysat_late-e4f461f97bd00990f2836a12fd487aa8-ddf15.jpg 148w,\n/static/polysat_late-e4f461f97bd00990f2836a12fd487aa8-6415c.jpg 295w,\n/static/polysat_late-e4f461f97bd00990f2836a12fd487aa8-bacc8.jpg 430w"\n        sizes="(max-width: 430px) 100vw, 430px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nDebugging LEO late into the night. I took this photo from the cleanroom computer. Nik (pictured) was operating the hardware while I worked on the software.\n</p>\n<p>In addition to doing general software support for each mission, I\'ve also completed several long-term projects. Descriptions of those projects follows.</p>\n<h3>Fault Tolerant Memory</h3>\n<p>Due to the harsh radiation environment of low earth orbit, and the price of radiation hardened components, all of PolySat\'s radiation fault tolerance is implemented in the software.</p>\n<p>Recently, the System Board (the PolySat flight computer) needed a redesign due to the obsolescence of some components. This meant a new flash-based memory architecture, and further, a new fault tolerant memory system implemented in software.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="System Board"\n        title=""\n        src="/static/sysboard-39f30084375edd6f36c2acd2ceffc727-ca545.jpg"\n        srcset="/static/sysboard-39f30084375edd6f36c2acd2ceffc727-aa1b7.jpg 148w,\n/static/sysboard-39f30084375edd6f36c2acd2ceffc727-b937a.jpg 295w,\n/static/sysboard-39f30084375edd6f36c2acd2ceffc727-ca545.jpg 590w,\n/static/sysboard-39f30084375edd6f36c2acd2ceffc727-75639.jpg 885w,\n/static/sysboard-39f30084375edd6f36c2acd2ceffc727-8bd51.jpg 1180w,\n/static/sysboard-39f30084375edd6f36c2acd2ceffc727-c0966.jpg 1632w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nDevelopment setup for the System Board. The System Board is in the bottom right--a single board computer that sits at top of each PolySat satellite.\n</p>\n<p>Since flash memory is susceptible to single event effects, I implemented a program in C that regularly computes a hash of all our critical software (the bootloader, Linux kernel, and core filesystem) and compares it to a hash that was computed on the ground. If the hash does not match, it is replaced by a valid copy stored somewhere else in memory.</p>\n<p>To protect against flash chip failure, we have multiple flash chips that maintain multiple copies of the critical software. These chips are separate from main memory on serial interfaces to leave adequate room in main memory for less critical data.</p>\n<p>This project also required significant modifications to the PolySat bootloader, which checks all kernel and file system images  for hash validity before loading them into RAM. The new memory architecture required adding robustness to the bootloader so the system could boot from several chips.</p>\n<h3>PPS Linux Kernel Module</h3>\n<p>This was my introduction to Linux kernel programming, and it was a really fun learning experience.</p>\n<p>In 2016, we added a GPS to our system, and we wanted to advantage of the GPS\'s timing accuracy to synchronize our clock. This was done by tying the GPS\'s pulse-per-second (PPS) line to one of our interrupts.</p>\n<p>I wrote a Linux kernel module that recorded the system time whenever an interrupt occurred. The recorded time was then made available to userspace via the read system call, and a program in userspace adjusted the system time accordingly. To learn how to do this, I read through the book <a href="http://shop.oreilly.com/product/9780596005900.do">Linux Device Drivers</a> and utilized a PolySat faculty advisor.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Small Sat"\n        title=""\n        src="/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-ca545.jpg"\n        srcset="/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-aa1b7.jpg 148w,\n/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-b937a.jpg 295w,\n/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-ca545.jpg 590w,\n/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-75639.jpg 885w,\n/static/smallsat-bae94e7472c988cd3bb58d90e608cacf-65169.jpg 960w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nOne of the benefits of being in PolySat--going to the SmallSat conference in Logan, Utah\n</p>\n<h3>Northrop Satellite Lead</h3>\n<p>I am currently the project lead for a 3U satellite PolySat is doing with Northrop Grumman. This entails leading a team of aerospace, electrical, mechanical, and software engineers to design a spacecraft. In addition, I regularly communicate with Northrop employees to manage funding, evaluate requirements, and make design decisions. This satellite is still in the design phase.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 507px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.53057199211045%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Northrop"\n        title=""\n        src="/static/northrop-satellite-lead-e3cd85e0eb6c59ba6de38359f2703306-d92b8.png"\n        srcset="/static/northrop-satellite-lead-e3cd85e0eb6c59ba6de38359f2703306-44f21.png 148w,\n/static/northrop-satellite-lead-e3cd85e0eb6c59ba6de38359f2703306-d32f4.png 295w,\n/static/northrop-satellite-lead-e3cd85e0eb6c59ba6de38359f2703306-d92b8.png 507w"\n        sizes="(max-width: 507px) 100vw, 507px"\n      />\n    </span>\n  </span>\n  </p>\n<p>In order to procure funding for the satellite, our team was required to present at a system requirements review (SRR) at the Northrop Grumman facility in El Segundo, California. After several weeks of preparation, I presented the satellite\'s command and data handling subsystem to a team of reviewers.</p>\n<p>In addition to being a great introduction to system engineering, the month of SRR preparation matured my ability to collaborate with a multidisciplinary team of engineers.</p>\n<h3>GPS Driver</h3>\n<p>This was my first project for PolySat when I joined as a freshman. It consisted of writing a userspace driver in C for a GPS. I was also invloved in testing and debugging the hardware once the electrical engineers had finished design and fabrication of the board.</p>\n<p>Once the software and hardware were working properly, I worked with Aerospace Corp to test the module in their GPS simulator. This was important because our module was a COTS GPS with its CoCom limits disabled, so we had little information on its orbital performance.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Small Sat"\n        title=""\n        src="/static/lightsail-6886bcc7296079834b1abd17e5a6861f-ca545.jpg"\n        srcset="/static/lightsail-6886bcc7296079834b1abd17e5a6861f-aa1b7.jpg 148w,\n/static/lightsail-6886bcc7296079834b1abd17e5a6861f-b937a.jpg 295w,\n/static/lightsail-6886bcc7296079834b1abd17e5a6861f-ca545.jpg 590w,\n/static/lightsail-6886bcc7296079834b1abd17e5a6861f-75639.jpg 885w,\n/static/lightsail-6886bcc7296079834b1abd17e5a6861f-8bd51.jpg 1180w,\n/static/lightsail-6886bcc7296079834b1abd17e5a6861f-c0966.jpg 1632w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nA picture from a [LightSail](http://www.planetary.org/explore/projects/lightsail-solar-sailing/) deployment test. We\'ve been working with the Planetary Society on the satellite since the beginning.\n</p>',frontmatter:{title:"PolySat"}}},pathContext:{slug:"/projects/polysat/"}}}});
